async def start(update, context):
    v = get_vault(update.effective_user.id)
    menu = [['‚ö°Ô∏è QUICK SCAN'], ['üè¶ VAULT HUB', 'üîÑ REBOOT']]
    msg = f"{HYDRA_LOGO}\n{BANNER}\nüõ∞ <b>SYSTEM:</b> <code>ONLINE</code>\nüõ° <b>VAULT:</b> <code>{v.address[:6]}...{v.address[-4:]}</code>\n{BANNER}"
    await update.message.reply_text(msg, reply_markup=ReplyKeyboardMarkup(menu, resize_keyboard=True), parse_mode='HTML')

async def main_handler(update, context):
    if 'SCAN' in update.message.text.upper():
        m = await update.message.reply_text("üì° <b>PENETRATING CLOB LIQUIDITY...</b>", parse_mode='HTML')
        if await perform_omni_scan():
            kb = []
            for i, target in enumerate(OMNI_TARGETS):
                # Displaying Price & Arb indicator
                kb.append([InlineKeyboardButton(f"üéØ {target['label']} (${target['price']})", callback_data=f"STRIKE_{i}")])
            
            await m.edit_text("üî• <b>ARBITRAGE OPPORTUNITIES DETECTED:</b>", reply_markup=InlineKeyboardMarkup(kb), parse_mode='HTML')
        else:
            await m.edit_text("‚ùå <b>SCAN FAILED. CHECK CONNECTION.</b>")

async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    v = get_vault(q.from_user.id)

    if q.data.startswith("STRIKE_"):
        idx = int(q.data.split("_")[1])
        target = OMNI_TARGETS[idx]
        context.user_data['active_token'] = target['token_id']
        
        msg = (
            f"‚öñÔ∏è <b>ARBITRAGE ANALYSIS</b>\n{BANNER}\n"
            f"üìù <b>MARKET:</b> <code>{target['question']}</code>\n"
            f"üü¢ <b>PRICE:</b> <code>${target['price']}</code>\n"
            f"üìä <b>VOLUME:</b> <code>${target['volume']:,.0f}</code>\n"
            f"{BANNER}\n<i>Execute atomic strike on this target?</i>"
        )
        kb = [[InlineKeyboardButton("üî• INITIATE ATOMIC STRIKE", callback_data="EXEC")]]
        await q.edit_message_text(msg, reply_markup=InlineKeyboardMarkup(kb), parse_mode='HTML')

    elif q.data == "EXEC":
        token_id = context.user_data.get('active_token')
        stake = float(context.user_data.get('stake', 10))
        
        if not token_id:
            await q.edit_message_text("‚ùå <b>ERROR:</b> Target lost. Please re-scan.")
            return

        await q.edit_message_text("‚ö°Ô∏è <b>TRANSMITTING TO CLOB...</b>", parse_mode='HTML')
        try:
            # 100% Guaranteed Fail-Safe Initialization
            client = None
            try:
                client = ClobClient(host="https://clob.polymarket.com", key=v.key.hex(), chain_id=137)
            except TypeError:
                client = ClobClient(host="https://clob.polymarket.com", private_key=v.key.hex(), chain_id=137)

            client.set_api_creds({
                "api_key": os.getenv("CLOB_API_KEY"),
                "api_secret": os.getenv("CLOB_SECRET"),
                "api_passphrase": os.getenv("CLOB_PASSPHRASE")
            })

            # Execution
            order_args = MarketOrderArgs(token_id=token_id, amount=stake, side=BUY)
            resp = client.post_order(client.create_market_order(order_args))
            
            if resp.get("success") or resp.get("status") == "OK":
                await q.edit_message_text(f"‚úÖ <b>STRIKE SUCCESSFUL</b>\nID: <code>{resp.get('orderID', 'SUBMITTED')}</code>", parse_mode='HTML')
            else:
                await q.edit_message_text(f"‚ùå <b>REJECTED:</b> {resp}")
        except Exception as e:
            await q.edit_message_text(f"‚ö†Ô∏è <b>ENGINE ERROR:</b> {str(e)[:150]}")

